  "inlineSchema": "generator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n/// Роли пользователей. Права описаны в middleware checkRole.\nenum Role {\n  DIRECTOR\n  DEPUTY\n  ADMIN\n  TEACHER\n  ACCOUNTANT\n}\n\nenum ChildStatus {\n  ACTIVE\n  LEFT\n}\n\nenum ClubEnrollmentStatus {\n  ACTIVE\n  WAITING_LIST\n  CANCELLED\n}\n\nenum FinanceType {\n  INCOME\n  EXPENSE\n}\n\nenum FinanceCategory {\n  NUTRITION\n  CLUBS\n  MAINTENANCE\n  SALARY\n}\n\nenum InventoryType {\n  FOOD\n  SUPPLIES\n}\n\nenum MaintenanceStatus {\n  NEW\n  IN_PROGRESS\n  DONE\n}\n\nenum MaintenanceType {\n  REPAIR\n  PURCHASE\n}\n\nmodel User {\n  id           Int      @id @default(autoincrement())\n  email        String   @unique\n  passwordHash String\n  role         Role\n  employeeId   Int      @unique\n  employee     Employee @relation(fields: [employeeId], references: [id])\n\n  actionLogs ActionLog[]\n  createdAt  DateTime    @default(now())\n  updatedAt  DateTime    @updatedAt\n}\n\nmodel Employee {\n  id                 Int       @id @default(autoincrement())\n  firstName          String\n  lastName           String\n  middleName         String?\n  position           String\n  rate               Float // ставка (можно Decimal, если нужна точность)\n  hireDate           DateTime\n  fireDate           DateTime?\n  contractEndDate    DateTime?\n  medicalCheckupDate DateTime?\n  attestationDate    DateTime?\n  branchId           Int\n  branch             Branch    @relation(fields: [branchId], references: [id])\n\n  user                User?\n  clubs               Club[]               @relation(\"TeacherClubs\")\n  maintenanceRequests MaintenanceRequest[]\n  createdAt           DateTime             @default(now())\n  updatedAt           DateTime             @updatedAt\n\n  @@index([branchId])\n}\n\nmodel Child {\n  id         Int         @id @default(autoincrement())\n  firstName  String\n  lastName   String\n  birthDate  DateTime\n  groupId    Int\n  group      Group       @relation(fields: [groupId], references: [id])\n  healthInfo String?\n  status     ChildStatus @default(ACTIVE)\n  documents  Json?\n\n  enrollments ClubEnrollment[]\n  attendance  Attendance[]\n  createdAt   DateTime         @default(now())\n  updatedAt   DateTime         @updatedAt\n\n  @@index([groupId])\n}\n\nmodel Group {\n  id       Int    @id @default(autoincrement())\n  name     String\n  branchId Int\n  branch   Branch @relation(fields: [branchId], references: [id])\n\n  children Child[]\n\n  @@unique([name, branchId]) // Название группы уникально в филиале\n  @@index([branchId])\n}\n\nmodel Club {\n  id          Int      @id @default(autoincrement())\n  name        String\n  description String?\n  teacherId   Int\n  teacher     Employee @relation(\"TeacherClubs\", fields: [teacherId], references: [id])\n  schedule    Json? // [{day: \"Monday\", time: \"16:00\"}]\n  cost        Decimal  @db.Decimal(12, 2)\n  maxStudents Int\n\n  enrollments ClubEnrollment[]\n  attendance  Attendance[]\n  createdAt   DateTime         @default(now())\n  updatedAt   DateTime         @updatedAt\n\n  @@unique([name, teacherId]) // Уникальность кружка по имени у конкретного педагога\n  @@index([teacherId])\n}\n\nmodel ClubEnrollment {\n  id      Int                  @id @default(autoincrement())\n  childId Int\n  clubId  Int\n  status  ClubEnrollmentStatus @default(ACTIVE)\n\n  child     Child    @relation(fields: [childId], references: [id])\n  club      Club     @relation(fields: [clubId], references: [id])\n  createdAt DateTime @default(now())\n\n  @@unique([childId, clubId]) // Один ребёнок — одна активная запись в кружок\n  @@index([clubId])\n  @@index([childId])\n}\n\nmodel Attendance {\n  id        Int      @id @default(autoincrement())\n  date      DateTime\n  childId   Int\n  clubId    Int? // null — посещаемость по основной группе (не кружок)\n  isPresent Boolean\n\n  child Child @relation(fields: [childId], references: [id])\n  club  Club? @relation(fields: [clubId], references: [id])\n\n  @@unique([date, childId, clubId]) // Уникальная отметка на дату/ребёнка/кружок\n  @@index([childId])\n  @@index([clubId])\n}\n\nmodel FinanceTransaction {\n  id          Int             @id @default(autoincrement())\n  amount      Decimal         @db.Decimal(14, 2)\n  type        FinanceType\n  category    FinanceCategory\n  description String?\n  date        DateTime\n  documentUrl String?\n\n  createdAt DateTime @default(now())\n\n  @@index([type, category, date])\n}\n\nmodel InventoryItem {\n  id         Int           @id @default(autoincrement())\n  name       String\n  quantity   Float // Можно Decimal, если нужна высокая точность\n  unit       String // \"кг\", \"шт\"\n  expiryDate DateTime?\n  type       InventoryType\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([type, expiryDate])\n}\n\nmodel Menu {\n  id       Int      @id @default(autoincrement())\n  date     DateTime\n  ageGroup String\n  meals    Json // [{name: \"Завтрак\", dish: \"Каша\", calories: 200}]\n\n  @@unique([date, ageGroup])\n  @@index([date])\n}\n\nmodel MaintenanceRequest {\n  id          Int               @id @default(autoincrement())\n  title       String\n  description String?\n  requesterId Int\n  requester   Employee          @relation(fields: [requesterId], references: [id])\n  status      MaintenanceStatus @default(NEW)\n  type        MaintenanceType\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([requesterId, status, type])\n}\n\nmodel SecurityLog {\n  id          Int      @id @default(autoincrement())\n  eventType   String // \"Проверка ПБ\", \"Инцидент\"\n  description String?\n  date        DateTime\n  documentUrl String?\n\n  createdAt DateTime @default(now())\n\n  @@index([date, eventType])\n}\n\nmodel Branch {\n  id      Int    @id @default(autoincrement())\n  name    String\n  address String\n\n  employees Employee[]\n  groups    Group[]\n\n  @@unique([name])\n}\n\nmodel ActionLog {\n  id        Int      @id @default(autoincrement())\n  userId    Int\n  user      User     @relation(fields: [userId], references: [id])\n  action    String // \"CREATE_CHILD\" и т.п.\n  details   Json?\n  timestamp DateTime @default(now())\n\n  @@index([userId, action, timestamp])\n}\n",
